//
// CONTACT_CONTRAINED_TIE_BREAK
// 


 ATTRIBUTES(COMMON) {
  
  // Initial and reference densities
  KEYWORD_STR       = VALUE(STRING, "Solver Keyword");
  LSD_EPPF          = VALUE(FLOAT, "Plastic strain failure");
}


SKEYWORDS_IDENTIFIER(COMMON)
{

 KEYWORD_STR        = 9000;
 LSD_EPPF           = 4346;
 
}


GUI(COMMON) {

 
ASSIGN(KEYWORD_STR, "*CONSTRAINED_TIE-BREAK");
optional:
 SCALAR(LSD_EPPF);
}
// File format
FORMAT(Keyword971) {

  COMMENT("$    SNSID     MNSID      EPPF");
  CARD("                    %10lg",LSD_EPPF);

 
}
